July 8th, 2010 

Charles gets bitten by a snake and rushed to the hospital. April, the nurse, can't find Charles' veins, so the doctor has no choice but to administrate the needle through his penis. After a while the nurse notices an odd side effect after the procedure, Charles has an enormous erection that won't go away. April tries to tell the doctor, but he can't be bothered and tells April to deal with it. She does so the only way she knows how.
